function Topics(){
    return <div> 
            <form>
                <h3>This is built using react. Topics are follows</h3>
                <h3>React components</h3>
                <h3>React states</h3>
                <h3>React Hooks</h3>
            </form>
        </div>
    
}
export default Topics;
